import React, { Component } from 'react';

class Search extends Component {


  render() {


    return (
      <div id="search-input">
        <input
            id="search-input"
            autoComplete="off"
            type="text"
            placeholder='Search by Location...'
            />
            {
              this.props.locations.length > 5 ?
              this.props.locations.map(l => {
                return <div>
                        <h1>{l.facilityname}</h1>
                        <p>{l.address}</p>
                        </div>
              })
              :
              <h1>poop</h1>
            }
      </div>
    );
  }

}

export default Search;
